        // A client-side or network error occurred. Handle it accordingly.\n        this.errMessage = `An error occurred : ${error.error.message}`;\n      } else {\n        // The backend returned an unsuccessful response code.\n        // The response body may contain clues as to what went wrong,\n        this.errMessage = `Backend returned code : ${error.status} | ` + `${error.error}`;\n      }\n    });\n  }\n\n  ngOnInit() {\n    this.commonService.getAllCommonData().subscribe(allCommonData => {\n      this.tenantNames = allCommonData['tenantNames'];\n    });\n  }\n\n}\n\n    \n\n    \n        \n  \n    \n      \n    \n    \n      Login\n      \n      \n      \n        \n          {{errMessage}}.\n        \n        \n          {{successMessage}}.\n        \n\n        \n          \n            Choose College\n             {{tenantName}}\n          \n        \n        \n          \n            College is required.\n          \n        \n\n        \n          Username\n          \n        \n        \n          \n            Username is required.\n          \n        \n        \n          Password\n          \n        \n        \n          \n            Password is required.\n          \n        \n        \n          \n            Submit\n          \n        \n      \n    \n  \n\n\n    \n\n    \n                \n                    ./login.component.css\n                \n                \n    \n\n    \n        \n        \n            \n                Legend\n            \n            \n                Html element\n            \n            \n                Component\n            \n            \n                Html element with directive\n            \n        \n    \n\n    \n\n\n\n\n\n\n        var COMPONENT_TEMPLATE = '                          Login                                    {{errMessage}}.                          {{successMessage}}.                                      Choose College             {{tenantName}}                                       